import "./App.css";
import Home from "./Home";

import { useState } from "react";

import { Carousel } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

import "./Style.css";
import Service from "./Service";

export default function App() {
  return (
    <div className="Carousel">
      <Carousel interval={null} controls={false}>
        <div class="carousel-indicators">
          <button
            type="button"
            data-bs-target=""
            aria-label="Slide 1"
            class="active"
            aria-current="true"
          ></button>
          <button
            type="button"
            data-bs-target=""
            aria-label="Slide 2"
            aria-current="false"
          ></button>
        </div>
        <Carousel.Item>
          <Home />
        </Carousel.Item>
        <Carousel.Item>
          <Service />
        </Carousel.Item>
      </Carousel>
    </div>
  );
}
